import React from 'react';
import '../Style/Portfolio.css';


class Portfolio extends React.Component {
    render(){
        return(
          <div className= "portfolio-panel" id = "portfolio">
              <div className= "container">
                  <div className= "orange-stripe"></div>
                  <h1 className= "portfolio-heading">Portfolio</h1>
                  <h5 className= "my-work">My Work</h5>
              </div>

              <div className= "projects">
                  <ul>
                      <li className= "prjects-images">
                          <img className= "project-image-img" src= {require('../Images/Projects/project1.PNG')} alt="Project 1"/>
                      </li>

                      <li className= "prjects-images">
                          <img className= "project-image-img" src= {require('../Images/Projects/project2.2.PNG')} alt="Project 1"/>
                      </li>

                      <li className= "prjects-images">
                          <img className= "project-image-img" src= {require('../Images/Projects/project2.PNG')} alt="Project 1"/>
                      </li>
                  </ul>
              </div>
          </div>
        )
    }
}

export default Portfolio;
